import React from 'react';
import { ProjectsContainer, Title, ProjectsWrapper, Project, ProjectImage, ProjectDescription, ProjectTitle,
         Description,Links, Link  } from './ExampleElements';

const Example = ({img, alt, title, description, githubLink, projectLink}) => {
  return (
     
      <ProjectsContainer id='projects'>
           <Title> 
          Projects
      </Title>
          <ProjectsWrapper>
              <Project>
              <ProjectImage src={img} alt={alt} />
                  <ProjectDescription>
                      <ProjectTitle>
                          {title}
                      </ProjectTitle>
                      <Description>
                          {description}
                      </Description>
                      <Links>
                      <Link href={githubLink}> github
                      </Link>                         
                      <Link  href={projectLink}> demo </Link>
                      </Links>
                  </ProjectDescription>
              </Project>
          </ProjectsWrapper>
      </ProjectsContainer>
  );
};

export default Example;
